import React from 'react'

const Produto = (dados) => {
  console.log(dados)

  return (
    <>
      <h1>{dados.dados.nome}</h1>
      <p>{dados.dados.descricao}</p>
      <p>{dados.dados.preco}</p>
      <img src={dados.dados.imagem} alt={dados.dados.nome}/>
    </>
  )
}

export default Produto
